    const handleButton = () => {
      props.showUsers();
      console.log(usersShow);

    }
    return (
      <div>
        <h2>hola</h2>
        <button onClick={handleButton}> aaaa</button>
      </div>
    );
  }


const mapStateToProps = (state) => {
  return {
    usersShow: state.usersShow,
  };
};

const mapDispatchToProps = {
  showUsers,
};

export default connect(mapStateToProps, mapDispatchToProps)(ShowUsers);
